import React from "react";
import { Link } from 'react-router-dom';
import MainHeader from './MainHeader';

import './MainNavigation.css';

function MainNavigation() {
  return (
    <React.Fragment>
      <MainHeader >
          <h1>
            <Link to="/">Keeper</Link>
          </h1>
      </MainHeader>
    </React.Fragment>
  );
}

export default MainNavigation;
